import { EMPTY_PROCESS } from '../../utils/constants';

export const getProcess = store => store.processReducer.process || EMPTY_PROCESS;
export const getDetailsProcess = store => store.processReducer.detailsProcess.process || {};
export const getHasDetailsProcess = store => store.processReducer.hasDetailsProcess.flag;
export const loadProcessesFromStore = store => store.processReducer.processList;

// * SELECTOR PRA NOVA LISTING VIEW
export const getDetailingEntry = store => store.processReducer.detailingEntry || {}; //SUBSTITUI getDetailsProcess
export const getShowDetailingEntry = store => store.processReducer.showDetailingEntry; //SUBSTITUI getHasDetailsProcess
export const getListingData = store => store.processReducer.processList; //SUBSTITUI loadProcessesFromStore

//
export const getShowEntryDialog = store => store.processReducer.showEntryDialog;
export const getProcessEntry = store => store.processReducer.processEntry || EMPTY_PROCESS; // SUBSTITUI getProcess
